const mongoose = require("mongoose");
const validator = require("validator");



var communitySchema = new mongoose.Schema({
    name: {
        type: String,
        required: true
    },
    status: {
        type: String,
        lowercase: true,
        default: "active"
    },
    method:{
        type: String,
        lowercase: true,
        default: "direct"
    },
    location:{
        type:String,
        default:"Not Added"
    },
    description:{
        type:String
    },
    owner:{
        id:{
            type:String
        },
        name:{
            type:String
        },
        email:{
            type:String
        }
    },
    img: {
        data: {
            type: Buffer,
            default : Buffer.from("", 'base64')

        }
    },

},
    {
        timestamps: true
    }
);

const community = mongoose.model("community", communitySchema);




communitySchema.methods.addCommunity = async function (newComm) {
    const comm = newComm
    try {
        await comm.save();
    }
    catch (error) {
        console.log(error);
    }

}


module.exports = community;